import React, {useEffect} from 'react';
import ReactGA from 'react-ga'
import Container from "./components/Container.js";
import Footer from "./components/Footer.js";
import Menu from "./Menu.js"
import CustomLogo from "./images/LogoWhite.jpg";
import { HashLink as Link } from 'react-router-hash-link';

function App() {

useEffect(() => {
  ReactGA.initialize('UA-211790415-1');
  ReactGA.pageview(window.location.pathname + window.location.search);
},[])

  return (
    <>
    <div className="container center">
        <nav className="menu">
          <img className="custom-logo" src={CustomLogo} alt="Custom Logo"></img>

            <div className="menu__right">
                <ul className="menu__list">
                    <li className="menu__list-item"><a className="menu__link menu__link--active" href="/">Home</a></li>
                    <li className="menu__list-item"><a className="menu__link" href="Container">About</a></li>
                    <li className="menu__list-item"><a className="menu__link" href="/">Music</a></li>
                    <Link to="VideoPlayer" className="menu__list-item"><a className="menu__link" >Videos</a></Link>
                    <li className="menu__list-item"><a className="menu__link" href="f">Contact</a></li>
                </ul>
            </div>
        </nav>
    </div>
    <Menu />
      <Container a id="Container" />
      <Footer a id="f"/>
    </>
  );
}

export default App;
